import React from 'react'

function MainMap() {
    return (
        <header style={headerStyle}>
            <h1>Map</h1>
        </header>
    )
}

const headerStyle = {
    backgroundColor: '#333',
    color: '#fff',
    textAlign: 'center',
    padding: '10px'
}

export default MainMap;
